import React from 'react';

export default function Adventure() {
  return (
    <div style={{ padding: 32, color: '#fff' }}>
      <h1>Adventure Mode</h1>
      <p>Here’s where your “Adventure Mode” game lives.</p>
    </div>
  );
}
